description:
Iraq: 10 Years On

War Documentary hosted by Kirsty Wark, published by BBC broadcasted as part of BBC Newsnight series in 2013 - English narration


Information
------------------------------

Kirsty Wark presents a special programme with a studio audience, looking at how Iraq and the world changed following the war ten years ago.

